import Carousel from './components/Carousel/Carousel';
import Header from './components/Header/Header';
import About from './components/about-us/about';
import OurTeam from "./components/OurTeam/OurTeam";
import PracticeArea from "./components/PracticeArea/PracticeArea";
import Litigation from "./components/Litigations/Litigation.jsx";
import Contact from "./components/Contact/Contact";
import Footer from "./components/Footer/Footer";
import Location from "./components/Location/Location";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
        <Carousel />
        <Routes exact path="/about" element={<About />} />
        <Routes exact path="/PracticeArea" element={<PracticeArea />} />
        <Routes exact path="/OurTeam" element={<OurTeam />} />
        <Routes exact path="/Litigation" element={<Litigation />} />
        <Routes exact path="/Contact" element={<Contact />} />
        <Location />
        </Switch>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
